import { container, title } from "../../material-kit-react.js";

const pillsStyle = {
  section: {
    padding: "100px 100px 0px 100x",
    marginLeft: "100px"

  },
  container,
  title: {
    ...title,
    marginLeft: "25px",
    marginTop: "10px",
    minHeight: "10px",
    textDecoration: "none"
  }
};

export default pillsStyle;
